import React, { useEffect, useState } from 'react';
import Layout from '../components/layout';
import { getTopSongs } from '../services/spotifyapi';

const TopSongs = () => {
  const [songs, setSongs] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  const fetchTopSongs = async () => {
    try {
      setLoading(true);
      setError(null);
      const topSongs = await getTopSongs();
      setSongs(topSongs);
    } catch (err) {
      console.error('Error:', err);
      setError('Failed to load top songs. Please try again.');
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchTopSongs();
  }, []);

  const handleRetry = () => {
    fetchTopSongs();
  };

  return (
    <Layout title="Deezer Top Songs" showNav={true}>
      {loading ? (
        <div style={styles.loading}>
          <div style={styles.spinner}></div>
          <p>Loading top songs from Deezer...</p>
        </div>
      ) : error ? (
        <div style={styles.errorContainer}>
          <p style={styles.errorText}>{error}</p>
          <button 
            style={styles.retryButton}
            onClick={handleRetry}
          >
            Retry
          </button>
        </div>
      ) : (
        <div style={styles.songsContainer}>
          <h2 style={styles.pageTitle}>Deezer Top 20 Tracks</h2>
          {songs.map((song, index) => (
            <div key={song.id} style={styles.songCard}>
              <div style={styles.songRank}>{index + 1}</div>
              <img 
                src={song.cover} 
                alt={`${song.title} cover`} 
                style={styles.coverArt}
                onError={(e) => {
                  e.target.src = 'https://via.placeholder.com/60';
                }}
              />
              <div style={styles.songInfo}>
                <h3 style={styles.songTitle}>{song.title}</h3>
                <p style={styles.songArtist}>{song.artist}</p>
                <p style={styles.songAlbum}>{song.album}</p>
              </div>
              <div style={styles.songDuration}>{song.duration}</div>
              {song.preview ? (
                <audio 
                  controls 
                  style={styles.audioPlayer}
                  preload="none"
                >
                  <source src={song.preview} type="audio/mp3" />
                </audio>
              ) : (
                <div style={styles.noPreview}>No preview</div>
              )}
            </div>
          ))}
        </div>
      )}
    </Layout>
  );
};

const styles = {
  songsContainer: {
    display: 'flex',
    flexDirection: 'column',
    gap: '20px',
    width: '100%',
    maxWidth: '800px',
    margin: '0 auto',
    padding: '0 20px',
  },
  pageTitle: {
    color: '#fff',
    textAlign: 'center',
    marginBottom: '20px',
    fontSize: '24px',
  },
  songCard: {
    display: 'flex',
    alignItems: 'center',
    padding: '15px',
    backgroundColor: 'rgba(255, 255, 255, 0.1)',
    borderRadius: '10px',
    transition: 'all 0.3s ease',
    '&:hover': {
      backgroundColor: 'rgba(255, 255, 255, 0.15)',
      transform: 'translateY(-3px)',
      boxShadow: '0 4px 8px rgba(0, 0, 0, 0.2)'
    }
  },
  coverArt: {
    width: '60px',
    height: '60px',
    borderRadius: '6px',
    marginRight: '20px',
    objectFit: 'cover',
    boxShadow: '0 2px 4px rgba(0, 0, 0, 0.2)'
  },
  songRank: {
    fontSize: '18px',
    fontWeight: 'bold',
    color: '#8e44ad',
    minWidth: '30px',
    textAlign: 'center',
    marginRight: '20px',
  },
  songInfo: {
    flex: 1,
    minWidth: 0,
    overflow: 'hidden',
  },
  songTitle: {
    color: '#fff',
    fontSize: '16px',
    margin: '0 0 5px 0',
    whiteSpace: 'nowrap',
    overflow: 'hidden',
    textOverflow: 'ellipsis',
  },
  songArtist: {
    color: 'rgba(255, 255, 255, 0.9)',
    fontSize: '14px',
    margin: '0 0 3px 0',
    whiteSpace: 'nowrap',
    overflow: 'hidden',
    textOverflow: 'ellipsis',
  },
  songAlbum: {
    color: 'rgba(255, 255, 255, 0.7)',
    fontSize: '12px',
    margin: 0,
    whiteSpace: 'nowrap',
    overflow: 'hidden',
    textOverflow: 'ellipsis',
  },
  songDuration: {
    color: 'rgba(255, 255, 255, 0.6)',
    fontSize: '14px',
    margin: '0 20px',
    whiteSpace: 'nowrap',
  },
  audioPlayer: {
    width: '150px',
    height: '40px',
    '@media (max-width: 768px)': {
      display: 'none'
    }
  },
  noPreview: {
    color: 'rgba(255, 255, 255, 0.4)',
    fontSize: '12px',
    width: '150px',
    textAlign: 'center',
  },
  loading: {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    justifyContent: 'center',
    height: '200px',
    color: 'rgba(255, 255, 255, 0.7)',
  },
  spinner: {
    border: '4px solid rgba(255, 255, 255, 0.1)',
    borderTop: '4px solid #8e44ad',
    borderRadius: '50%',
    width: '40px',
    height: '40px',
    animation: 'spin 1s linear infinite',
    marginBottom: '15px',
  },
  errorContainer: {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    justifyContent: 'center',
    height: '200px',
    color: '#ff6b6b',
  },
  errorText: {
    marginBottom: '20px',
    fontSize: '16px',
  },
  retryButton: {
    padding: '10px 20px',
    backgroundColor: '#8e44ad',
    color: 'white',
    border: 'none',
    borderRadius: '5px',
    cursor: 'pointer',
    fontSize: '16px',
    transition: 'background-color 0.3s',
    '&:hover': {
      backgroundColor: '#9b59b6',
    }
  }
};

export default TopSongs;
